function App() {
  const [searchTerm, SetSearchTerm] = useState("");
  return (
    <div className="App">
      <Header />

      <input
        placeholder="Search Item..."
        onChange={(event) => {
          SetSearchTerm(event.target.value);
        }}
      />

      <div className="cardsBox">
        {data.filter((item) => {
            if (searchTerm === "") {
              return item;
            } else if (
              item.categories.toLowerCase().includes(searchTerm.toLowerCase())
            ) {
              return item;
            } else return false
          })
          .map((item) => {
            return (
              <Cards
                key={item.id}
                img={item.img}
                price={item.price}
                name={item.name}
              />
            );
          })}
      </div>
      <Footer />
    </div>
  );
}

export default App;
